DROP TABLE IF EXISTS `boke_article`;
CREATE TABLE `boke_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(45) DEFAULT NULL COMMENT '文章标题',
  `readCounts` int(8) DEFAULT '0' COMMENT '阅读量',
  `excerpt` varchar(45) DEFAULT NULL COMMENT '简介',
  `author` varchar(45) DEFAULT NULL COMMENT '作者',
  `createdAt` datetime DEFAULT NULL COMMENT '发布日期',
  `category` varchar(45) DEFAULT NULL COMMENT '类别',
  `listPic` varchar(200) DEFAULT NULL COMMENT '主图url',
  `mdcontent` varchar(2000) DEFAULT NULL COMMENT '文章内容',
  `shareCode` varchar(200) DEFAULT NULL COMMENT '海报分享二维码url',
