  KEY `areaCode` (`area_code`) USING BTREE,
  KEY `parentId` (`parent_id`) USING BTREE,
  KEY `level` (`level`) USING BTREE,
  KEY `areaName` (`area_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3260 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='地区码表';

